  "inlineSchema": "// Landlord Portfolio - Prisma Schema\n// PostgreSQL with enums and relations for India + Dubai landlords\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// ============== ENUMS ==============\n\nenum Country {\n  IN // India\n  AE // UAE / Dubai\n}\n\nenum Currency {\n  INR\n  AED\n}\n\nenum UnitStatus {\n  VACANT\n  OCCUPIED\n}\n\nenum RentFrequency {\n  MONTHLY\n  QUARTERLY\n  YEARLY\n  CUSTOM\n}\n\nenum ScheduleStatus {\n  DUE\n  OVERDUE\n  PAID\n  PARTIAL\n}\n\nenum ChequeStatus {\n  RECEIVED\n  DEPOSITED\n  CLEARED\n  BOUNCED\n  REPLACED\n}\n\nenum PaymentMethod {\n  CHEQUE\n  BANK_TRANSFER\n  UPI\n  CASH\n}\n\nenum Gender {\n  MALE\n  FEMALE\n  OTHER\n  PREFER_NOT_TO_SAY\n}\n\n// ============== MODELS ==============\n\nmodel User {\n  id        String   @id @default(uuid())\n  email     String   @unique\n  password  String\n  name      String?\n  mobile    String?\n  gender    Gender?\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  properties Property[]\n  tenants    Tenant[]\n  leases     Lease[]\n  cheques    Cheque[]\n  payments   Payment[]\n}\n\nmodel Property {\n  id             String   @id @default(uuid())\n  name           String\n  address        String?\n  country        Country\n  emirateOrState String? // optional: emirate (Dubai) or state (India)\n  currency       Currency\n  notes          String?\n  createdAt      DateTime @default(now())\n  updatedAt      DateTime @updatedAt\n  ownerId        String\n\n  owner    User      @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  units    Unit[]\n  leases   Lease[]\n  cheques  Cheque[]\n  payments Payment[]\n}\n\nmodel Unit {\n  id         String     @id @default(uuid())\n  unitNo     String // e.g. \"101\", \"A-2\"\n  bedrooms   Int?\n  status     UnitStatus @default(VACANT)\n  notes      String?\n  createdAt  DateTime   @default(now())\n  updatedAt  DateTime   @updatedAt\n  propertyId String\n\n  property Property  @relation(fields: [propertyId], references: [id], onDelete: Cascade)\n  leases   Lease[]\n  cheques  Cheque[]\n  payments Payment[]\n}\n\nmodel Tenant {\n  id        String   @id @default(uuid())\n  name      String\n  phone     String?\n  email     String?\n  idNumber  String? // optional ID (Aadhaar, Emirates ID, etc.)\n  notes     String?\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  ownerId   String\n\n  owner    User      @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  leases   Lease[]\n  cheques  Cheque[]\n  payments Payment[]\n}\n\nmodel Lease {\n  id                String        @id @default(uuid())\n  startDate         DateTime      @db.Date\n  endDate           DateTime      @db.Date\n  rentFrequency     RentFrequency\n  installmentAmount Decimal       @db.Decimal(14, 2)\n  dueDay            Int // 1-28\n  securityDeposit   Decimal?      @db.Decimal(14, 2)\n  notes             String?\n  createdAt         DateTime      @default(now())\n  updatedAt         DateTime      @updatedAt\n  propertyId        String\n  unitId            String\n  tenantId          String\n  ownerId           String\n\n  property      Property       @relation(fields: [propertyId], references: [id], onDelete: Cascade)\n  unit          Unit           @relation(fields: [unitId], references: [id], onDelete: Cascade)\n  tenant        Tenant         @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  owner         User           @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  rentSchedules RentSchedule[]\n  cheques       Cheque[]\n  payments      Payment[]\n\n  @@index([unitId, startDate, endDate])\n}\n\nmodel RentSchedule {\n  id             String         @id @default(uuid())\n  dueDate        DateTime       @db.Date\n  expectedAmount Decimal        @db.Decimal(14, 2)\n  paidAmount     Decimal?       @db.Decimal(14, 2) // for PARTIAL\n  status         ScheduleStatus @default(DUE)\n  createdAt      DateTime       @default(now())\n  updatedAt      DateTime       @updatedAt\n  leaseId        String\n\n  lease    Lease                  @relation(fields: [leaseId], references: [id], onDelete: Cascade)\n  payments PaymentScheduleMatch[]\n}\n\nmodel Cheque {\n  id                  String       @id @default(uuid())\n  chequeNumber        String\n  bankName            String\n  chequeDate          DateTime     @db.Date\n  amount              Decimal      @db.Decimal(14, 2)\n  coversPeriod        String // e.g. \"Feb 2026 Rent\"\n  status              ChequeStatus @default(RECEIVED)\n  depositDate         DateTime?    @db.Date\n  clearedOrBounceDate DateTime?    @db.Date\n  bounceReason        String?\n  notes               String?\n  createdAt           DateTime     @default(now())\n  updatedAt           DateTime     @updatedAt\n  // Denormalized for filters\n  leaseId             String\n  tenantId            String\n  propertyId          String\n  unitId              String\n  ownerId             String\n  replacedByChequeId  String?      @unique // when status = REPLACED, link to new cheque\n\n  lease          Lease    @relation(fields: [leaseId], references: [id], onDelete: Cascade)\n  tenant         Tenant   @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  property       Property @relation(fields: [propertyId], references: [id], onDelete: Cascade)\n  unit           Unit     @relation(fields: [unitId], references: [id], onDelete: Cascade)\n  owner          User     @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  replacedBy     Cheque?  @relation(\"ChequeReplacement\", fields: [replacedByChequeId], references: [id])\n  replacesCheque Cheque?  @relation(\"ChequeReplacement\")\n}\n\nmodel Payment {\n  id         String        @id @default(uuid())\n  date       DateTime      @db.Date\n  amount     Decimal       @db.Decimal(14, 2)\n  method     PaymentMethod\n  reference  String?\n  notes      String?\n  createdAt  DateTime      @default(now())\n  updatedAt  DateTime      @updatedAt\n  leaseId    String\n  tenantId   String\n  propertyId String\n  unitId     String\n  ownerId    String\n  chequeId   String?\n\n  lease           Lease                  @relation(fields: [leaseId], references: [id], onDelete: Cascade)\n  tenant          Tenant                 @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  property        Property               @relation(fields: [propertyId], references: [id], onDelete: Cascade)\n  unit            Unit                   @relation(fields: [unitId], references: [id], onDelete: Cascade)\n  owner           User                   @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  scheduleMatches PaymentScheduleMatch[]\n}\n\n// Many-to-many: Payment (or cleared cheque) can match one or more RentSchedule entries\nmodel PaymentScheduleMatch {\n  id             String   @id @default(uuid())\n  amount         Decimal  @db.Decimal(14, 2) // amount applied to this schedule\n  createdAt      DateTime @default(now())\n  paymentId      String\n  rentScheduleId String\n\n  payment      Payment      @relation(fields: [paymentId], references: [id], onDelete: Cascade)\n  rentSchedule RentSchedule @relation(fields: [rentScheduleId], references: [id], onDelete: Cascade)\n\n  @@unique([paymentId, rentScheduleId])\n}\n",
